$(function(){describe("RSS Feeds",function(){it("are defined",function(){expect(allFeeds).toBeDefined();expect(allFeeds.length).not.toBe(0)});it("should have a url for each feed",function(){for(var a in allFeeds){expect(allFeeds[a].url).toBeDefined();expect(allFeeds[a].url).not.toBe("")}});it("should have a name for each feed",function(){for(var a in allFeeds){expect(allFeeds[a].name).toBeDefined();expect(allFeeds[a].name).not.toBe("")}})});describe("The Menu",function(){it("should be hidden by default",function(){expect(document.getElementsByTagName("body")[0].className).toBe("menu-hidden")});it("should show when menu button is clicked and hide when clicked again",function(){$(".menu-icon-link").trigger("click");expect(document.getElementsByTagName("body")[0].className).toBe("");$(".menu-icon-link").trigger("click");expect(document.getElementsByTagName("body")[0].className).toBe("menu-hidden")});it("should have a menu item for each item in the allFeeds array",function(){expect($(".feed-list li").length).toBe(allFeeds.length)})});describe("Initial Entries",function(){beforeEach(function(a){loadFeed(0,function(){a()})});it("should have at least a single entry element within the .feed container",function(){var a=$(".feed .entry")[0];expect(a).toBeGreaterThan("")})});describe("New Feed Selection",function(){var b;var a;beforeEach(function(c){loadFeed(0,function(){b=$(".feed .entry")[0];loadFeed(1);a=$(".feed .entry")[1];loadFeed(0,c)})});it("should change the content for the subsequent entries",function(){expect(a).not.toBe(b)})})}());